import { useState, useEffect } from 'react';
import Form from './components/CalculatorForm/Form';
import WindAdjustment from './components/CalculatorForm/WindAdjustment';
import ResultsDisplay from './components/CalculatorForm/ResultsDisplay';
import { needsWindInput, calculateWindModification } from './utils/windModification';


const COMPETITION_POINTS = {
  OW: { // Olympic/World Championships
    1: 375, 2: 330, 3: 300, 4: 270, 5: 250, 6: 230, 7: 215, 8: 200,
    9: 130, 10: 120, 11: 110, 12: 100, 13: 95, 14: 90, 15: 85, 16: 80
  },
  DF: { // Diamond Final
    1: 240, 2: 210, 3: 185, 4: 170, 5: 155, 6: 145, 7: 135, 8: 125,
    9: 90, 10: 80, 11: 70, 12: 60
  },
  GW: { // Diamond League
    1: 200, 2: 170, 3: 150, 4: 140, 5: 130, 6: 120, 7: 110, 8: 100,
    9: 70, 10: 60, 11: 50, 12: 45
  },
  GL: { // Continental Gold
    1: 170, 2: 145, 3: 130, 4: 120, 5: 110, 6: 100, 7: 90, 8: 80,
    9: 60, 10: 50, 11: 45, 12: 40
  },
  A: { // Category A
    1: 140, 2: 120, 3: 110, 4: 100, 5: 90, 6: 80, 7: 70, 8: 60
  },
  B: { // Category B
    1: 100, 2: 80, 3: 70, 4: 60, 5: 55, 6: 50, 7: 45, 8: 40
  },
  C: { // Category C
    1: 60, 2: 50, 3: 45, 4: 40, 5: 35, 6: 30, 7: 27, 8: 25
  },
  D: { // Category D
    1: 40, 2: 35, 3: 30, 4: 25, 5: 22, 6: 19, 7: 17, 8: 15
  },
  E: { // Category E
    1: 25, 2: 21, 3: 18, 4: 15, 5: 12, 6: 10
  },
  F: { // Category F
    1: 15, 2: 10, 3: 5
  }
};

const MEET_LABELS = {
  OW: "Olympics/Worlds",
  DF: "Diamond Final",
  GW: "Diamond League",
  GL: "Diamond League Final",
  A: "Category A",
  B: "Category B",
  C: "Category C",
  D: "Category D",
  E: "Category E",
  F: "Category F"
};

function CompetitionTable({ 
  points,
  eventType, 
  onCalculatePerformance,
}) {
  // Define the fixed competition level points
  const competitionPoints = {
    'OLYMPICS/WORLDS': {
      1: 375, 2: 330, 3: 300, 4: 270, 5: 250, 6: 230, 7: 215, 8: 200, 9: 130, 
      10: 120, 11: 110, 12: 100, 13: 95, 14: 90, 15: 85, 16: 80
    },
    'DIAMOND FINAL': {
      1: 240, 2: 210, 3: 185, 4: 170, 5: 155, 6: 145, 7: 135, 8: 125, 9: 90,
      10: 80, 11: 70, 12: 60
    },
    'DIAMOND LEAGUE': {
      1: 200, 2: 170, 3: 150, 4: 140, 5: 130, 6: 120, 7: 110, 8: 100, 9: 70,
      10: 60, 11: 50, 12: 45
    },
    'DIAMOND LEAGUE FINAL': {
      1: 170, 2: 145, 3: 130, 4: 120, 5: 110, 6: 100, 7: 90, 8: 80, 9: 60,
      10: 50, 11: 45, 12: 40
    },
    'CATEGORY A': {
      1: 140, 2: 120, 3: 110, 4: 100, 5: 90, 6: 80, 7: 70, 8: 60
    },
    'CATEGORY B': {
      1: 100, 2: 80, 3: 70, 4: 60, 5: 55, 6: 50, 7: 45, 8: 40
    },
    'CATEGORY C': {
      1: 60, 2: 50, 3: 45, 4: 40, 5: 35, 6: 30, 7: 27, 8: 25
    },
    'CATEGORY D': {
      1: 40, 2: 35, 3: 30, 4: 25, 5: 22, 6: 19, 7: 17, 8: 15
    },
    'CATEGORY E': {
      1: 25, 2: 21, 3: 18, 4: 15, 5: 12, 6: 10
    },
    'CATEGORY F': {
      1: 15, 2: 10, 3: 5
    }
  };

  return (
    <div className="competition-page">
      <div className="competition-main">
        <h2>Competition Level Comparison</h2>
        <div className="base-points-section">
          <h3>Base Points</h3>
          <div className="points-display">
            {points || 'Enter points'}
            <span className="meet-level">No bonus</span>
          </div>
        </div>

        <h3>Total Points (Performance + Placement)</h3>
        <table className="competition-table">
          <thead>
            <tr>
              <th>PLACE</th>
              <th>OLYMPICS/WORLDS</th>
              <th>DIAMOND FINAL</th>
              <th>DIAMOND LEAGUE</th>
              <th>DIAMOND LEAGUE FINAL</th>
              <th>CATEGORY A</th>
              <th>CATEGORY B</th>
              <th>CATEGORY C</th>
              <th>CATEGORY D</th>
              <th>CATEGORY E</th>
              <th>CATEGORY F</th>
            </tr>
          </thead>
          <tbody>
            {[...Array(16)].map((_, index) => {
              const place = index + 1;
              return (
                <tr key={place}>
                  <td>{place}</td>
                  {Object.keys(competitionPoints).map(level => (
                    <td key={level}>
                      {competitionPoints[level][place] 
                        ? (points || 0) + competitionPoints[level][place]
                        : '-'}
                    </td>
                  ))}
                </tr>
              );
            })}
          </tbody>
        </table>
      </div>
    </div>
  );
}

export default CompetitionTable;
